'use strict';

const Item = require('../Item');
/**
 * @class
 * @hideconstructor
 * @extends HomeyAPIV3.Item
 * @memberof HomeyAPIV3.ManagerDrivers
 */
class PairSession extends Item {

  static transformGet(item) {
    item = super.transformGet(item);

    delete item.uri;

    return item;
  }

}

module.exports = PairSession;
